
def break_cipher(text):
    """
    :param text: long encrypted english text using substitution cipher, spaces removed, all caps.
                 assuming input is cleaned and correct as specified in the question.
    :return decryptedText: using frequency analysis, prints and returns decrypted string into the same format as input

    """
    # finds and returns a reverse sorted list of 2-tuples: (char C, numTimes) generated by input text
    # i.e.[('D', 21912), ('S', 16587), ('Z', 14810), ..., ('P', 205), ('I', 188), ('Y', 128),]
    sortedTextFrequencies = sorted(get_frequencies(text).items(), key=itemgetter(1), reverse=True)

    # generates a list of 2-tuples (char C, % frequency) sorted by decreasing % frequency
    # i.e. [('E', 12.02), ('T', 9.10), ('A', 8.12), ..., ('Q', 0.11), ('J', 0.10), ('Z', 0.07),]
    sortedLetterFrequencies = sorted([('A', 8.12), ('B', 1.49), ('C', 2.71), ('D', 4.32), ('E', 12.02),
                                      ('F', 2.30), ('G', 2.03), ('H', 5.92), ('I', 7.31), ('J', 0.10),
                                      ('K', 0.69), ('L', 3.98), ('M', 2.61), ('N', 6.95), ('O', 7.68),
                                      ('P', 1.82), ('Q', 0.11), ('R', 6.02), ('S', 6.30), ('T', 9.10),
                                      ('U', 2.88), ('V', 1.11), ('W', 2.09), ('X', 0.17), ('Y', 2.11),
                                      ('Z', 0.07)],  key=itemgetter(1), reverse=True)

    # cleans two sorted lists above and gets rid of second value in each tuple, so only two lists of characters remain
    letterFrequenciesText = (tup[0] for tup in sortedTextFrequencies)  # list of most popular characters in input
    letterFrequenciesEnglish = (tup[0] for tup in sortedLetterFrequencies)  # list of most popular characters in English

    #generate a dictionary with ciphered letter as a key and corresponding deciphered character as its value
    # i.e. { 'D': 'E', 'S': 'T', 'Z': 'A', ..., 'P': 'Q', 'I': 'J', 'Y: 'Z'} --> "DZS" == "EAT" and "IZYY" == "JAZZ"
    encryptionCode = dict(zip(letterFrequenciesText, letterFrequenciesEnglish))

    # decrypt text using encryptionCode
    # for really long inputs, as promised by the TA's, law of large numbers should ensure that this has high accuracy
    decryptedText = decrypt(text, encryptionCode)
    print(decryptedText)
    return decryptedText


def get_frequencies(text):
    # returns dictionary with letters 'A' through 'Z' as keys
    # and the number of times each letter appears mapped to its key i.e. {..., 'F': 534, ...}
    characterCount = {}
    for c in text:
        if c in characterCount:  # if already a key, increment it
            characterCount[c] += 1
        else:  # add c as a key into dictionary
            characterCount[c] = 1
    return characterCount


def decrypt(text, encryptionCode):
    # go through each letter in text and replace with its deciphered letter using the dictionary encryptionCode
    decrypted = ""
    for c in text:
        decrypted += encryptionCode[c]
    return decrypted


